		"id_str": "1018686575868178432",
		"text": "그러나 공연스태프가 무대장치를 활용하기 위해 돌출무대 주변을 배회하며 공연 몰입을 방해한다. 휴대폰 불빛, 서로의 대화소리. 무전 등. 관객의 공연관람에 피해를 주지 않아야 한다. 그게 가장 중요한 것 아닌가. 충분한 리허설이 이뤄졌어야 한다.",
